tables.table_schema:
CREATE TABLE QuantumEntanglementMeasures (
    id INT PRIMARY KEY,
    particle1_id INT,
    particle2_id INT,
    entanglement_measure FLOAT
);

CREATE TABLE particle_entanglement (
    id SERIAL PRIMARY KEY,
    particle_1_id INT,
    particle_2_id INT,
    entanglement_measure DECIMAL
);

CREATE TABLE entanglement_properties (
    property_id SERIAL PRIMARY KEY,
    property_name VARCHAR(50),
    property_description TEXT
);

CREATE TABLE QuantumParticles (
    particle_id UUID PRIMARY KEY,
    particle_type VARCHAR(50),
    entanglement_measure DECIMAL
);

CREATE TABLE particles (
    particle_id INT PRIMARY KEY,
    particle_name VARCHAR(255),
    entanglement_measure FLOAT
);

CREATE TABLE experiments (
    experiment_id INT PRIMARY KEY,
    experiment_name VARCHAR(255)
);

CREATE TABLE particles (
    particle_id INT PRIMARY KEY,
    particle_name VARCHAR(50) NOT NULL,
    entanglement_measure FLOAT NOT NULL
);

CREATE TABLE entanglement_types (
    type_id INT PRIMARY KEY,
    type_name VARCHAR(50) NOT NULL
);

CREATE TABLE particle_types (
    particle_type_id INT PRIMARY KEY,
    particle_type_name VARCHAR(50) NOT NULL,
    description TEXT
);
